import React, { Component } from 'react'

class Mynavigation extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li>
                        <link to="/">Home</link>
                        <link to="/page1">Page1</link>
                        <link to="/page2">Page2</link>
                        <link to="/page3">Page3</link>
                    </li>
                </ul>
            </div>
        )
    }
}
export default mynavigation
